import React, { Component } from 'react'
import { Link } from 'react-router-dom'
import './Nav.css';

export default class Nav extends Component {
    render() {
        return (
            <nav>
          <div>
              <ul>
                  <a className>
                  <Link to="/">Home</Link>
                  </a>
                  <a>
                  <Link to="/about">About</Link>
                  </a>
              </ul>
          </div>
        </nav>
        )
    }
}
